      """  Reporting currency value of this field  """  
      self.Rpt2LineDiscAmt:int = obj["Rpt2LineDiscAmt"]
      """  Reporting currency value of this field  """  
      self.Rpt3LineDiscAmt:int = obj["Rpt3LineDiscAmt"]
      """  Reporting currency value of this field  """  
      self.Rpt1TotalMiscChrg:int = obj["Rpt1TotalMiscChrg"]
      """  Reporting currency value of this field  """  
